nformation for staff to enable users with questions or suggestions to interact with repository experts.',NULL,'A',NULL,NULL,'Repository'),(39,7,1,'The repository is established on standard core infrastructure components including hardware, operating systems, and supporting software.',NULL,'A','I',NULL,'Repository'),(40,8,1,'Tools that can be used to analyze each dataset are listed on the corresponding dataset pages.',NULL,NULL,'I','R','Repository'),(41,9,1,'The repository maintains licenses to manage data access and use.',NULL,NULL,NULL,'R','Repository'),(42,10,1,'The repository hosts data and metadata according to a set of defined criteria to ensure that the resources provided are consistent with the intent of the repository.',NULL,NULL,NULL,'R','Repository'),(43,11,1,'The repository provides sufficient detail about its data and metadata so that users are able to evaluate the quality of these resources.',NULL,NULL,NULL,'R','Repository'),(44,12,1,'Metadata are linked to other relevant datasets, vocabularies and ontologies.',NULL,NULL,NULL,'R','Repository'),(45,13,1,'The repository provides documentation for each resource to permit its complete and accurate citation.',NULL,NULL,NULL,'R','Repository'),(46,14,1,'Sufficient metadata are provided for each dataset to permit accurate and useful employment of the dataset.',NULL,NULL,NULL,'R','Repository'),(47,15,1,'A description of the methods used to acquire the data is provided.',NULL,NULL,NULL,'R','Repository'),(48,16,1,'Version information is provided for each resource, where available.',NULL,NULL,NULL,'R','Repository');
