heir browser, thus eliminating the need to install and maintain complex software.',4),(65,'Cell Image Library','http://www.cellimagelibrary.org/','Repository','The Cell Image Library™ is a freely accessible, easy-to-search, public repository of reviewed and annotated images, videos, and animations of cells from a variety of organisms, showcasing cell architecture, intracellular functionalities, and both normal and abnormal processes. The purpose of this database is to advance research, education, and training, with the ultimate goal of improving human health.',4),(66,'Genomic Data Commons','https://portal.gdc.cancer.gov/projects','Repository','The NCI\'s Genomic Data Commons (GDC) provides the cancer research community with a unified data repository that enables data sharing across cancer genomic studies in support of precision medicine.',4),(67,'LDG-1283','http://lincsportal.ccs.miami.edu/datasets/#/view/LDS-1343','Dataset','GCP data -  MCF10A Common Project Global chromatin epigentic profiles of MCF10A cell line treated with 8 FDA-approved drugs.',1),(68,'ontoCAT','http://bioconductor.org/help/bioc-views/release/bioc/html/ontoCAT.html','Tool','ontoCAT: anRpackage for ontology traversal and search',3),(69,'ArrayMaker','https://github.com/cw2014/ArrayMaker/','Tool','Simple, rapid and accurate genotyping-by-sequencing from aligned whole genomes with ArrayMaker',3),(70,'zfin.org','http://zfin.org/cgi-bin/webdriver?MIval=aa-ZDB_home.apg','Repository','The Zebrafish Information Network',2),(71,'UniProt KnowledgeBase','http://www.uniprot.org/','Repository','A Portal for Curated Information of Protein Sequence, Classification and Function',2),(72,'UCSC Genome Bioinformatics','http://genome.ucsc.edu/','Repository','A Portal for Genomic Data',2),(73,'RGD','http://www.rgd.mcw.edu/','Repository','The Rat Genome Database',2),(74,'MGI','http://www.informatics.jax.org/','Repository','The Mouse Genome Database',2),(75,'INSYGHT','http://genome.jouy.inra.fr/Insyght','Tool','Synchronized navigation and comparative analyses across Ensembl complete bacterial genomes with INSYGHT',3),(76,'LDG-1107','http://lincsportal.ccs.miami.edu/datasets/#/view/LDS-1110','Dataset','(R)-Roscovitine KINOMEscan For the panel of kinases, the percent of kinase bound by ligand is measured in the presence of (R)-Roscovitine at 10 uM of concentration.',1),(77,'GenomeHubs','http://GenomeHubs.org','Tool','GenomeHubs: simple containerized setup of a custom Ensembl database and web server for any species ',3),(78,'HaploReg','http://compbio.mit.edu/HaploReg','Repository','HaploReg is a tool for exploring annotations of the noncoding genome at variants on haplotype blocks, such as candidate regulatory SNPs at disease-associated loci. Using LD information from the 1000 Genomes Project, linked SNPs and small indels can be visualized along with chromatin state and protein binding annotation from the Roadmap Epigenomics and ENCODE projects, sequence conservation across mammals, the effect of SNPs on regulatory motifs, and the effect of SNPs on expression from eQTL studies. HaploReg is designed for researchers developing mechanistic hypotheses of the impact of non-coding variants on clinical phenotypes and normal variation.',5),(79,'GenBank','http://www.ncbi.nlm.nih.gov/genbank/','Repository','GenBank is the NIH genetic sequence database, an annotated collection of all publicly available DNA sequences.  GenBank is part of the International Nucleotide Sequence Database Collaboration, which comprises the DNA DataBank of Japan (DDBJ), the European Molecular Biology Laboratory (EMBL), and GenBank at NCBI. These three organizations exchange data on a daily basis. The complete release notes for the current version of GenBank are available on the NCBI ftp site. A new release is made every two months.  GenBank growth statistics for both the traditional GenBank divisions and the WGS division are available from each release.',5),(80,'GlycoNAVI','http://glyconavi.org/','Repository','GlycoNAVI is a gateway to free suite of carbohydrate research tools. It will let you access to variety of information and assist your research.',5),(81,'ADHDgene','http://adhd.psych.ac.cn/','Repository','A genetic database for attention deficit hyperactivity disorder.  ADHDgene aims to provide research community with a central genetic resource and analysis platform for ADHD, to help unveil the genetic basis of ADHD and to contribute to global mental health.',5),(82,'Allele frequency resource for research and teaching','http://alfred.med.yale.edu','Repository','ALFRED is designed to make allele frequency data on human population samples readily available for use by the scientific and educational communities.',5),(83,'Animal Transcription Factor Database','http://www.bioguo.org/AnimalTFDB/','Repository','AnimalTFDB is a comprehensive animal transcription factor database. The resource is classification of transcription factors from 50 genomes from species including Homo sapiens and Caenorhabditis elegans. The database also has information on co-transcription factors and chromatin remodelling factors.',5),(84,'Apo and Holo structures DataBase','http://ahdb.ee.ncku.edu.tw/','Repository','AH-DB (Apo and Holo structures DataBase) collects the apo and holo structure pairs of proteins. Proteins are frequently associated with other molecules to perform their functions. Experimental structures determined in the bound state are named holo structures; while structures determined in the unbound state are named apo structures.',5),(85,'Aspergillus Genome Database','http://www.aspgd.org','Repository','The Aspergillus Genome Database is a resource for genomic sequence data as well as gene and protein information for Aspergilli. This publicly available repository is a central point of access to genome, transcriptome and polymorphism data for the fungal research community.',5),(86,'BioSample at the European Bioinformatics Institute','http://www.ebi.ac.uk/biosamples','Repository','The BioSamples database aggregates sample information for reference samples (e.g. Coriell Cell lines) and samples for which data exist in one of the EBI\'s assay databases such as ArrayExpress, the European Nucleotide Archive or PRIDE. It provides links to assays an specific samples, and accepts direct submissions of sample information.',5),(87,'BuG@Sbase','http://bugs.sgul.ac.uk/bugsbase/','Repository','BuG@Sbase is a microbial gene expression and comparative genomic database containing microarray datasets.',5),(88,'SNAP','http://www.broad.mit.edu/mpg/snap/','Tool','SNAP: a web-based tool for identification and annotation of proxy SNPs using HapMap',3),(89,'LDG-1187','http://lincsportal.ccs.miami.edu/datasets/#/view/LDS-1190','Dataset','5z-7-oxozeaenol KINOMEscan For the panel of kinases, the percent of kinase bound by ligand is measured in the presence of 5z-7-oxozeaenol at 10 uM of concentration.',1),(90,'UniProt:Swiss-Prot','http://www.uniprot.org/','Repository','UniProtKB/Swiss-Prot is a manually annotated, non-redundant protein sequence database. It combines information extracted from scientific literature and biocurator-evaluated computational analysis. The aim of UniProtKB/Swiss-Prot is to provide all known relevant information about a particular protein. Annotation is regularly reviewed to keep up with current scientific findings. The manual annotation of an entry involves detailed analysis of the protein sequence and of the scientific literature.',4),(91,'ClinVar','https://www.ncbi.nlm.nih.gov/clinvar/','Repository','ClinVar aggregates information about genomic variation and its relationship to human health.',4),(92,'Clinical Trials Network','https://datashare.nida.nih.gov/','Repository','A repository of data from completed CTN clinical trials to be distributed to investigators in order to promote new research, encourage further analyses, and disseminate information to the community. Secondary analyses produced from data sharing multiply the scientific contribution 